import React from "react";
import { Route, RouteComponentProps, Switch, Redirect } from "react-dom";
import "./App.css";
import Sider from "./pages/Dashboard";
function App() {
  return (
    <Switch>
      <Route path={"/"} render={<Sider />} />
      {/* <Route path={"/login"} render={} /> */}
      {/* <Route path={"/register"} render={} /> */}
      <Route path={"/dashboard"} render={<Sider />} />
      {/* <Route path={"course"} render={} /> */}
      <Redirect to={"404"} />
    </Switch>
  );
}

export default App;
